import { createReducer, on } from '@ngrx/store';
import { setUser, usSetUser } from './auth.actions';
export const initialState = {
  user: null
};
const authReducer = createReducer(initialState, on(setUser, (state, {
  user
}) => ({
  ...state,
  user: {
    ...user
  }
})), on(usSetUser, state => ({
  ...state,
  user: null
})));
